import React, { useState } from "react";

const Mouse = () => {
  const [mouse, setMouse] = useState({
    height: "70px",
    width: "70px",
    borderRadius: 300,
    border: "2px solid red",
    position: "absolute"
  });
  return (
    <div>
      <div className="circle" style={setMouse}></div>
    </div>
  );
};

export default Mouse;
